1.1. 功能介绍
设备 OTA 指的是设备通过网络进行固件的下载并更新的过程。固件升级业务包可以帮助你快速集成设备固件升级的能力。
1.2. 接入组件
在工程的 Podfile 文件中添加 OTA 业务包组件，并执行 pod update 命令
source "https://github.com/TuyaInc/TuyaPublicSpecs.git"
