无
1.4. 使用指南
1.4.1. 注意事项

使用任何接口之前，务必确认用户已登录
获取商城页面之前，需要首先确认当前用户所注册的服务区是否开通商城服务
登录用户发生变化时，务必重新判断商城可用状态并重新获取商城页面
获取商城页面为 UIViewController，务必使用 UINavigationController 进行 push 或 present 展示


商城与用户信息强相关
