1. 配网业务包1.1. 功能介绍1.1.1. 1、Wi-Fi 设备配网1.1.2. 2、ZigBee 设备配网1.1.3. 3、蓝牙设备配网1.1.4. 4、扫码配网设备1.1.5. 5、自动发现配网1.2. 接入组件1.3. 自定义配置1.3.1. 1、蓝牙配网功能1.3.2. 2、设备热点名称设置1.4. 服务协议1.4.1. 提供服务1.4.2. 依赖服务1.5. 使用指南1.5.1. 注意事项1.5.2. 进入配网1.5.3. 自定义配网品类列表返回1.6. 更新记录1. 配网业务包
1.1. 功能介绍
业务功能涵盖了目前涂鸦智能的 Wi-Fi 设备、ZigBee 设备、蓝牙设备、支持二维码扫码的设备（例如 GPRS & NB-IoT 设备）等不同类型的设备配网前置操作引导和具体入网激活实现
1.1.1. 1、Wi-Fi 设备配网
支持 Wi-Fi 智能设备入网连接云服务，Wi-Fi 设备配网主要有 EZ 模式和 AP 模式两种，其中 IPC 设备支持扫二维码方式配网



名词
说明




EZ 模式
又称快连模式，App 把配网数据包打包到802.11数据包的指定区域中，发送到周围环境；智能设备的 WiFi 模块处于混杂模式下，监听捕获网络中的所有报文，按照约定的协议数据格式解析出 App 发出配网信息包。


AP 模式
又称热点模式，手机作为 STA 连接智能设备的热点，双方建立一个 Socket 连接通过约定端口交互数据。


IPC 设备扫码配网
摄像头设备通过扫描 App 上的二维码获取配网数据信息



1.1.2. 2、ZigBee 设备配网
支持 ZigBee 网关和子设备配网



名词
说明




ZigBee 网关
融合 ZigBee 网络中协调器和 Wi-Fi 功能的设备，负责 ZigBee 网络的组建及数据信息存储。


子设备
ZigBee 网络中的路由或者终端设备，负责数据转发或者终端控制响应。



1.1.3. 3、蓝牙设备配网
涂鸦蓝牙有三条技术线路，主要包括 SingleBLE、SigMesh、TuyaMesh 以及双模设备



名词
说明




SingleBLE
通过蓝牙与手机一对一相连的蓝牙单点设备


SigMesh
采用蓝牙技术联盟发布的蓝牙拓扑通信


TuyaMesh
采用涂鸦自研的蓝牙拓扑通信


双模设备
支持多协议的设备，即同时具备 Wi-Fi 能力和 BLE 能力的设备



1.1.4. 4、扫码配网设备
该类设备上电后即连接了涂鸦云服务，APP 通过扫描设备上的二维码（必须是涂鸦云服务支持的二维码规则，支持固件具体接入方式可咨询涂鸦科技相关商务及项目经理）使能设备去涂鸦云激活绑定



名词
说明




GPRS 设备
采用 GPRS 通信技术接入网络连接云服务的智能设备


NB-IOT 设备
采用窄带物联网( NarrowBand-Internet of Things )技术的智能设备



1.1.5. 5、自动发现配网
融合涂鸦智能通用配网技术实现，为用户提供一套快捷配网的功能
1.2. 接入组件
在工程的 Podfile 文件中添加配网业务包组件，并执行 pod update 命令
