Wi-Fi  设备配网过程需要获取手机当前连接 Wi-Fi  名称，需要项目开启地位权限来获取 Wi-Fi  的名称，在 info.plist 中添加如下权限声明，创建 CLLocationManager 示例，并调用 requestWhenInUseAuthorization 方法。
